Belfast 1943. Als een jonge Amerikaanse piloot neerstort begrijpt hij dat hij niet lang meer te leven heeft. Hij geeft zijn 
verlovingsring aan een man uit de buurt, met het verzoek de ring naar zijn vriendin terug te brengen. Maar de oorlog verhindert 
de man om aan die laatste wens te voldoen. Vijftig jaar later vindt een jonge inwoner van Belfast de ring en hij besluit deze 
alsnog terug te brengen.
